class RunGurobi(object):

    def __init__(self):
        self.logger = logging.getLogger(
            self.__module__ + "." + self.__class__.__name__)

    def run(self, scen):
        optimizer = SMAC(scenario=scen)

        try:
            optimizer.optimize()
        except (TAEAbortException, FirstRunCrashedException) as err:
            self.logger.error(err)

